window.bookSummaryJSON = "<p>Just when I thought I’d get a vacation with the love of my undead life, my life blows up. Again.</p> <p>Sun and naughty fun is off the docket. Eliminating deadly Dhampirs is at the top of the to-do list. Crap.</p> <p>How in the ever-loving heck does a bloody note written on a paper towel and rag magazines left by Satan turn into a Vamp-hunt for idiots who think creating Dhampirs to attain world domination is a smooth move? The secret life of the entire Vampyre species is now on the line.</p> <p>Welcome to my Hell on Earth.</p> <p>With an insane crew of two warriors who don’t know their heads from their rear ends, a Demon who can break glass with her voice, Martha and Jane—who are foulmouthed and clothing-impaired, and a tiny Vamp with fangs as big as her body, I’m going to solve the problem come Hell or high water. Hopefully it’s just high water. I could do without the Hell part ...</p> <p>I’m ready to rumble and ready to win. The stakes are too high to lose. Plus, I need a freaking vacation. Work before play. We just need to survive it first.</p>"; 
